import classes from './AvailableMeals.module.css';
import Card from '../UI/Card';
import MealItem from './MealItem/MealItem';


const DUMMY_meals =[
    {
        id: 'm1',
        name: 'Sushi',
        description: 'Finest fish and veggies',
        price: 29.99,
    },
    {
        id: 'm2',
        name: 'Biryani',
        description: ' Bashmati rice and chicken leg peices, spicy added.',
        price: 15.99,
    },
    {
        id: 'm3',
        name: 'Full Meals',
        description: 'Rice, Chapati and Curry',
        price: 12.99
    },
    {
        id: 'm4',
        name: 'Curd rice',
        description: 'Cured rice - 450ml',
        price: 9.99,
    },
];


const AvailableMeals =()=>{
    const mealsList = DUMMY_meals.map(type=> <MealItem name = {type.name} description ={type.description} price={type.price}/>);
    return(
        <section className={classes.meals}>
          <Card>   
            <ul>
                {mealsList}
            </ul>
          </Card>
        </section>
    );

}

export default AvailableMeals;
